import React from 'react';

function About() {
  return (
    <div style={{ minHeight: '100vh', padding: '2rem', textAlign: 'center' }}>
      <h2 style={{ fontSize: '2.5rem', marginBottom: '1rem' }}>
        About This Project
      </h2>
      <p style={{ fontSize: '1.2rem', maxWidth: '700px', margin: '0 auto' }}>
        This Earthquake Dashboard provides visual insights and predictions based on historical seismic data.
        It aims to make earthquake data more accessible and understandable through interactive tools and real-time visualizations.
      </p>
    </div>
  );
}

export default About;
